import React, {Component} from "react"

class Home extends Component{
    constructor(props)
    {
        super();
        this.age=props.age;

    }
    onMakeOlder()
    {
        this.age+=3;
    }
    render()
    {

        return(
            <div>
                <p>Im inside another component</p>
                <p>Your name is {this.props.name},Age is {this.props.age}</p>
                <hr/>
                <button  className="btn-dark" onClick="this.onMakeOlder()">Make Me Older</button>
            </div>
            )
    }
}
export default Home
